import React, { Component } from 'react';
import { Container, Jumbotron,Row,Col } from 'reactstrap';
import { Media } from 'reactstrap';

class Profile extends Component {
    constructor(props){
        super(props);
    }

    
  render()
   {
    return (
      <Jumbotron fluid>
        <Media>
         
          <div class="media">
          <Container fluid >
           <img class="align-self-center ml-3" data-src="holder.js/300x200" alt="Avatar"class="roundedCircle"></img>
          </Container>
          <Container fluid >
           <Row>
             <Col sm="8">
          
            <div class="media-heading">
            <span class="border border-dark">
             <h1 class="ml=5" >Username</h1></span>
            </div>
             </Col>
           </Row> 
          </Container>
          </div>
         
        </Media>
      </Jumbotron>
    );
   };
}

export default Profile
